import { Row, Col } from "react-simple-flex-grid";

export default () => (
  <div id="aboutUs">
    <Container>
      <div style={{ padding: "2rem 5rem 5rem 5rem" }}>
        <h1 style={{ textAlign: "center", marginBlockEnd: "0px" }}>About Us</h1>
        <div className="separator">
          <span>
            <i className="fa fa-circle" />
          </span>
        </div>
      </div>
    </Container>
  </div>
);
